        this.state.leaderboards.map((lb) => {
            return <option>lb</option>
        })
    }

    render(){
        return <div>
            <form>
                <select>
                    {this.getLeaderboarOptions()}
                </select>
                <button>Press to update score</button>
            </form>
        </div>
    }
}

export default GameConatiner
